import { FaUserCircle } from 'react-icons/fa';
import "./Patient.css";

function PatientComponent() {
  const [accountAddress, setAccountAddress] = useState("0x123456789...");
  const timelineData = [
    {
      date: "January 2022",
      title: "Annual Physical Exam",
      description: "Routine checkup with primary care physician",
    },
    {
      date: "November 2021",
      title: "Emergency Room Visit",
      description:
        "Admitted for chest pain; discharged after tests showed no major issues",
    },
    {
      date: "October 2021",
      title: "Flu Shot",
      description: "Received seasonal flu vaccine at local pharmacy",
    },
    {
        date: "January 2022",
        title: "Annual Physical Exam",
        description: "Routine checkup with primary care physician",
      },
      {
        date: "November 2021",
        title: "Emergency Room Visit",
        description:
          "Admitted for chest pain; discharged after tests showed no major issues",
      },
      {
        date: "October 2021",
        title: "Flu Shot",
        description: "Received seasonal flu vaccine at local pharmacy",
      },
      {
        date: "January 2022",
        title: "Annual Physical Exam",
        description: "Routine checkup with primary care physician",
      },
      {
        date: "November 2021",
        title: "Emergency Room Visit",
        description:
          "Admitted for chest pain; discharged after tests showed no major issues",
      },
      {
        date: "October 2021",
        title: "Flu Shot",
        description: "Received seasonal flu vaccine at local pharmacy",
      },
  ];

  return (
    <div className="Patient-body-container">
      <div class="patient-container">

        {/* Timeline of the patient medical history */}
        <div className="timeline-container">
          <div class="timeline-header"> Timeline of Health Activites </div>
          <div class="timeline">
            {timelineData.map((event, index) => (
              <div key={index} className="timeline-event">
                <div className="timeline-event-date">{event.date}</div>
                <div className="timeline-event-details">
                  <div className="timeline-event-title">
                    <b>{event.title}</b>
                  </div>
                  <div className="timeline-event-description">
                    {event.description}
                  </div>
                </div>
                {index !== timelineData.length - 1 && (
                  <hr className="timeline-event-separator" />
                )}
              </div>
            ))}
          </div>
        </div>

        {/* Profile of the patient */}
        <div className="profile-container">
          <h1> Profile of the Patient </h1>
          <div className="account-address-container">
          <div className="account-address">{accountAddress}</div>
          <FaUserCircle className="profile-icon" />
        </div>
        </div>
      </div>
    </div>
  );
}

export default PatientComponent;
